import { Typeahead } from "react-bootstrap-typeahead";
import { actorMovieDTO } from "../actors/actors.model";

export default function TypeAheadActors(props: typeAheadActorsProps) {
    const actor: actorMovieDTO[] = [{
        id: 1, name: "Felipe", character: "", picture: ""
    },
    {
        id: 2, name: "Faldipe", character: "", picture: ""
    },
    {
        id: 3, name: "Zelipe", character: "", picture: ""
    }
    ]
    return (
        <div className="mb-3">
            <label htmlFor="">{props.displayName}</label>
            <Typeahead id="typeahead"
                onChange={(actors) => console.log(actors)}
                options={actor}
                labelKey={actor => actor.name}
                filterBy={['name']}
                placeholder="Write the name of the actor"
                minLength={1}
            ></Typeahead>
        </div>
    )
}

interface typeAheadActorsProps {
    displayName: string;
    actors: actorMovieDTO[];
}
